import './App.css';
import './assets/css/index.css';
import  Client  from "./pages/Choix_page/Client";
import  Back_office  from "./pages/Choix_page/Back_office";
import { Routes, Route, Link} from "react-router-dom";

function App() {
  const linkStyle = {
    color:'#748B6F'
  }
  return (
    <>
    <Link to={"/"}>
      <div className='box-ensemble'>
        <Link to="/Client" style={linkStyle}>
          <Client/>
        </Link>

        <Link to="/Back_office" style={linkStyle}>
          <Back_office/>
        </Link>

      </div>
    </Link>


  <Routes>
    <Route path="/">
      <Route path="Client" />
      <Route path="Back_office" />
   </Route>
  </Routes>
    </>
  )
}

export default App;
